import React from 'react';
import './App.css';
import Sketch from "./components/p5";

function App() {
  return (
    <div style = {backgroundColor = "white"} className="App">
      <header className="App-header">
        <h1>Hello</h1>
        <Sketch />
      </header>
    </div>
  );
}

export default App;
